import React from 'react'
import logo from '../images/logo.svg';
import { Link } from 'react-router-dom';


const NavBarView = (payload) => {
    const { searchOnchangeHandler } = payload
    return (
        <nav className="navbar-wrapper">
            <div className="navbar-left-side">
                <div className="logo-wrapper"><img src={logo} alt="nothing here" /></div>
                <div className="header__search">
                <input type="text"  className="header__search__input" onChange={(e) => { searchOnchangeHandler(e.target.value) }} />
                </div>
            </div>

            <div className="navbar-right-side">
                <Link to="/cart"> <div className="mycart-logo-wrapper">
                <button className="header__cart"><i className="fa fa-cart-plus" >Cart</i></button>  </div> </Link>
                <Link to="/">  <div className="products-link-wrapper">
                <button className="header__home"><i className="fa fa-home" >Home</i></button>  </div> </Link>
            </div>
        </nav>
    )
}


export default NavBarView;
